query getHandlePositionByModuleIdQuery($modules: [Int!]) {
  getHandlePositionByModule(modules: $modules) {
    shutterId
    handlePositions {
      positionId
      desc
      location
      xOffset
      yOffset
      zOffset
      rotationFromXY
      rotationInXY
      forBase
      forWall
      forTall
      __typename
    }
    __typename
  }
}
